//session
function SessionExpireAlert(timeout) {
    sessionStorage.clear(),
        window.sessionStorage.clear(),
        window.sessionStorage.clear(),
        sessionStorage.clear();
    var seconds = timeout / 1000;
    document.getElementsByName("secondsIdle").innerHTML = seconds;
    document.getElementsByName("seconds").innerHTML = seconds;
    setInterval(function () {
        document.getElementById("seconds").innerHTML = seconds;
        document.getElementById("secondsIdle").innerHTML = seconds;
    }, 1000);
    setTimeout(function () {
        $find("mpeTimeout").show();
    }, timeout - 10 * 1000);
    setTimeout(function () {
        sessionStorage.clear(),
        sessionStorage.clear(),
        window.sessionStorage.clear(),
        window.location = "session.htm";
    }, timeout);
};
function ResetSession() {
    window.location = window.location.href;
}
$(document).ready(function () {

    window.history.pushState(null, "", window.location.href);
    window.onpopstate = function () {
        window.history.pushState(null, "", window.location.href);
    };
});

$(function () {
    $(".numeric").bind("keypress", function (e) {
        var keyCode = e.which ? e.which : e.keyCode
        var ret = ((keyCode >= 48 && keyCode <= 57) || specialKeys.indexOf(keyCode) != -1);
        $(".error").css("display", ret ? "none" : "inline");
        return ret;
    });
    $(".numeric").bind("paste", function (e) {
        return false;
    });
    $(".numeric").bind("drop", function (e) {
        return false;
    });
});

//alerts
//header:<strong>alert!</strong>
//alert:message
function _n_plain_mes(header, alert) {
    $.notify({
        title: header,
        message: alert
    });
}
//alerts
//header:<strong>alert!</strong>
//alert:message
//type:success,warning,danger
function _n_plain_mes_1(header, alert, type) {
    $.notify({
        title: header,
        message: alert
    }, {
        type: type
    });
}


//title:<strong>Saving</strong> Do not close this page...
//message:'<strong>Saving</strong> Page Data.'
function _n_progress_message(title, message, settime) {
    var notify = $.notify(title, {
        type: 'success',
        allow_dismiss: false,
        showProgressbar: true
    });

    setTimeout(function () {
        notify.update('message', message);
    }, settime);

}

